import React, { useState, useRef } from 'react';
import { Grid, Checkbox, FormControlLabel, Paper, IconButton } from '@mui/material';
import ArrowUpwardIcon from '@mui/icons-material/ArrowUpward';
import ArrowDownwardIcon from '@mui/icons-material/ArrowDownward';

// A function to swap two elements in an array
const swapArrayElements = (arr, a, b) => {
    let temp = arr[a];
    arr[a] = arr[b];
    arr[b] = temp;
};

const SortableList = () => {
    const draggingItem = useRef();
    // The initial data for the list items
    const initialData = [
        { id: 'receiveFile', label: 'Receive File' },
        { id: 'statisticsAndChecks', label: <span>Statistics &<br /> Checks</span> },
        { id: 'columnValidation', label: 'Column Validation' },
        { id: 'unpack', label: 'Unpack' },
        { id: 'fieldLengthVerify', label: 'Field Length Verify' },
        { id: 'buildItinerary', label: 'Build Itinerary' },
        { id: 'workTableCreation', label: 'Work Table Creation' },
        { id: 'classify', label: 'Classify' },
        { id: 'errorDetails', label: 'Error Details' },
        { id: 'errorPatternsCleared', label: 'Error Patterns Cleared' },
        { id: 'normalizations', label: 'Normalizations' },
        { id: 'captureEmptyRows', label: 'Capture Empty Rows' },
        { id: 'identifyPrematch', label: 'Identify Prematch' },
        { id: 'identifyProcess', label: 'Identify Process' },
        { id: 'identifyPostValidation', label: 'Identify Post Validation' },
        { id: 'identifyDataUpdate', label: 'Identify Data Update' },
        { id: 'dataMoveWorkToStage', label: 'Data Move Work to Stage' },
        { id: 'dataMoveWorkToArchive', label: 'Data Move Work to Archive' },
        { id: 'clearTables', label: 'Clear Tables' },
        { id: 'setFilePeriod', label: 'Set File Period' },
    ];

    const [items, setItems] = useState(initialData);

    const handleCheckboxChange = (id) => (event) => {
        setItems(
            items.map((item) =>
                item.id === id ? { ...item, checked: event.target.checked } : item
            )
        );
    };

    const onDragStart = (event, index) => {
        draggingItem.current = index;
    };

    const onDragEnter = (event, index) => {
        const draggedItem = items[draggingItem.current];
        if (index !== draggingItem.current) {
            setItems((items) => {
                return items.filter((item) => item !== draggedItem);
            });
            setItems((items) => {
                return [
                    ...items.slice(0, index),
                    draggedItem,
                    ...items.slice(index, items.length),
                ];
            });
        }
    };

    const renderItem = (item, index) => (
        <Grid item xs={12} key={item.id}>
            <Paper
                style={{
                    width: '100%',
                    padding: '8px',
                    boxSizing: 'border-box',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'space-between',
                }}
            >
                <div>
                    <span style={{ marginRight: '8px' }}>{index + 1}.</span>
                    <FormControlLabel
                        control={
                            <Checkbox
                                checked={item.checked}
                                onChange={handleCheckboxChange(item.id)}
                                color="primary"
                            />
                        }
                        label={item.label}
                    />
                </div>
                <div>
                    <IconButton size="small" style={{ marginRight: '4px' }}>
                        <ArrowUpwardIcon />
                    </IconButton>
                    <IconButton size="small">
                        <ArrowDownwardIcon />
                    </IconButton>
                </div>
            </Paper>
        </Grid>
    );

    // The index to split the list into two columns
    const halfwayIndex = 10;

    const firstHalfItems = items.slice(0, halfwayIndex);
    const secondHalfItems = items.slice(halfwayIndex);

    return (
        <Grid container spacing={2} style={{ paddingLeft: '20px', paddingTop: '20px' }}>
            <Grid item xs={6}>
                {firstHalfItems.map((item, index) => (
                    <div
                        key={item.id}
                        draggable
                        onDragStart={(e) => onDragStart(e, index)}
                        onDragEnter={(e) => onDragEnter(e, index)}
                    >
                        {renderItem(item, index)}
                    </div>
                ))}
            </Grid>
            <Grid item xs={6}>
                {secondHalfItems.map((item, index) => (
                    <div
                        key={item.id}
                        draggable
                        onDragStart={(e) => onDragStart(e, index + halfwayIndex)}
                        onDragEnter={(e) => onDragEnter(e, index + halfwayIndex)}
                    >
                        {renderItem(item, index + halfwayIndex)}
                    </div>
                ))}
            </Grid>
        </Grid>
    );
};

export default SortableList;
